function App() {
  const [center, setCenter] = useState({ lat: 43.6532, lng: -79.3832 });
  // const [geoFences, setGeoFences] = useState([]);
  const [selectedPlace, setSelectedPlace] = useState(null);
  const [autocomplete, setAutocomplete] = useState(null);
  const [paths, setPaths] = useState([]);

  const handleOnclick = (value) => {
    setPaths(_paths[value])
  }

  const onLoad = (autocomplete) => {
    setAutocomplete(autocomplete);
  };

  const onPlaceChanged = () => {
    console.log("autocomplete", autocomplete)
    if (autocomplete !== null) {

      const place = autocomplete.getPlace();


      console.log("INIIIN", place,);

      if (place.geometry) {
        setCenter({
          lat: place.geometry.location.lat(),
          lng: place.geometry.location.lng()
        });
        setSelectedPlace(place);
      } else {
        console.log("Place not found");
      }
      const bounds = new window.google.maps.LatLngBounds(center);
      console.log("Bounds", bounds.toSpan());
    }
  };
  return (
    <div>
      <Autocomplete
        onLoad={onLoad}
        onPlaceChanged={onPlaceChanged}
      >
        <input
          type="text"
          placeholder="Enter a location"
        />
      </Autocomplete>

      <button onClick={() => handleOnclick("burlington")}>
        Burlington
      </button>
      <button onClick={() => handleOnclick("alberta")}>
        alberta
      </button>
      <button onClick={() => handleOnclick("ontario")}>
        ontario
      </button>
      {/* <input type="text" placeholder="Search for a block..." onChange={handleSearch} /> */}
      <Map center={center} selectedPlace={selectedPlace} paths={paths} />
    </div>
  );
}

export default App;
